<template><div><div class="hint-container warning">
<p class="hint-container-title">Примечание</p>
<p>В облачном версии есть ограничения на использования API.</p>
</div>
<h1 id="rest-api" tabindex="-1"><a class="header-anchor" href="#rest-api"><span>Rest API</span></a></h1>
<p>Система представляет API для решения основных задач - получения и изменения диаграмм, получения и изменения элементов архитектуры. API работает по протоколу HTTP, сериализация - JSON.</p>
<h2 id="авторизация" tabindex="-1"><a class="header-anchor" href="#авторизация"><span>Авторизация</span></a></h2>
<h3 id="получения-ключа-api" tabindex="-1"><a class="header-anchor" href="#получения-ключа-api"><span>Получения ключа API</span></a></h3>
<p>Для получения ключа API перейдите в раздел команда, вкладка &quot;Настройки команды&quot; и сгенерируйте ключ:</p>
<p><img src="@source/enterprise/api-1.png" alt="image"></p>
<h3 id="использование-ключа" tabindex="-1"><a class="header-anchor" href="#использование-ключа"><span>Использование ключа</span></a></h3>
<p>Добавляйте заголовок <strong>&quot;X-Api-Key&quot;</strong> ко всем запросам, отправляемым в API. Действия внутри системы будут выполняться от имени Администратора команды.</p>
<h1 id="ограничения-api-в-облачнои-версии" tabindex="-1"><a class="header-anchor" href="#ограничения-api-в-облачнои-версии"><span>Ограничения API в облачной версии</span></a></h1>
<ul>
<li>
<p><strong>Ограничение скорости по умолчанию</strong>- 5 запросов в 1 минуту.  Вы можете найти оставшиеся запросы в заголовке ответа X-Rate-Limit-Remaining.</p>
</li>
<li>
<p><strong>Размер одного запроса по умолчанию</strong> - 10 Мб. Вы не можете загрузить больше за один запрос.</p>
</li>
</ul>
<p>Если вы достигнете своей квоты, вы получите это сообщение:</p>
<div class="language-javascript line-numbers-mode" data-ext="js" data-title="js"><pre v-pre class="language-javascript"><code><span class="token punctuation">{</span>
    <span class="token string-property property">"timestamp"</span><span class="token operator">:</span> <span class="token string">"2022-06-28T12:03:03.438+00:00"</span><span class="token punctuation">,</span>
    <span class="token string-property property">"status"</span><span class="token operator">:</span> <span class="token number">429</span><span class="token punctuation">,</span>
    <span class="token string-property property">"error"</span><span class="token operator">:</span> <span class="token string">"Too Many Requests"</span><span class="token punctuation">,</span> 
    <span class="token string-property property">"message"</span><span class="token operator">:</span> <span class="token string">"You have exhausted your API Request Quota"</span><span class="token punctuation">,</span>
    <span class="token string-property property">"path"</span><span class="token operator">:</span> <span class="token string">"/public-api/v1/upload-diagrams"</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>В заголовке ответа X-Rate-Limit-Retry-After-Seconds вы можете узнать, сколько секунд вам нужно подождать до следующей попытки.</p>
<div class="hint-container caution">
<p class="hint-container-title">Предупреждение</p>
<p>Если вы превысите лимит более 3 раз за 24 часа, ваша учетная будет заблокирована. Обратитесь в чат, если такое произошло и вы не злоумышленник.</p>
</div>
<h2 id="методы-api" tabindex="-1"><a class="header-anchor" href="#методы-api"><span>Методы API</span></a></h2>
<h3 id="загрузка-диаграмм" tabindex="-1"><a class="header-anchor" href="#загрузка-диаграмм"><span>Загрузка диаграмм</span></a></h3>
