Тело запроcа:</p>
<div class="language-javascript line-numbers-mode" data-ext="js" data-title="js"><pre v-pre class="language-javascript"><code><span class="token punctuation">[</span> <span class="token comment">//массив процессов</span>
     <span class="token punctuation">{</span>
        <span class="token string-property property">"id"</span><span class="token operator">:</span>  <span class="token string">"Meeting Scheduling:1:1123"</span><span class="token punctuation">,</span> <span class="token comment">//внешний идентификатор процесса</span>
        <span class="token comment">// ниже тело диаграммы в XML. сделайте escape всех символов.</span>
        <span class="token string-property property">"xml"</span><span class="token operator">:</span> <span class="token string">"&lt;?xml version=\"1.0\" encoding=\"UTF-8\"?>\n&lt;bpmn:definitions xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:bpmn=\"http://www.omg.org/spec/BPMN/20100524/MODEL\" xmlns:bpmndi=\"http://www.omg.org/spec/BPMN/20100524/DI\" xmlns:dc=\"http://www.omg.org/spec/DD/20100524/DC\" xmlns:di=\"http://www.omg.org/spec/DD/20100524/DI\" xmlns:storm=\"http://storm.bpmn2.ru/ns\" id=\"Definitions_1k3dlqi\" targetNamespace=\"http://bpmn.io/schema/bpmn\">\n  &lt;bpmn:process id=\"Process_1\" isExecutable=\"false\">\n    &lt;bpmn:startEvent id=\"StartEvent_1\">\n      &lt;bpmn:outgoing>SequenceFlow_1cqyhs3&lt;/bpmn:outgoing>\n    &lt;/bpmn:startEvent>\n    &lt;bpmn:endEvent id=\"EndEvent_0zk83sa\">\n      &lt;bpmn:incoming>Flow_01sknpp&lt;/bpmn:incoming>\n    &lt;/bpmn:endEvent>\n    &lt;bpmn:sequenceFlow id=\"SequenceFlow_1cqyhs3\" sourceRef=\"StartEvent_1\" targetRef=\"Activity_0yu8ycq\" />\n    &lt;bpmn:sequenceFlow id=\"Flow_01sknpp\" sourceRef=\"Activity_0yu8ycq\" targetRef=\"EndEvent_0zk83sa\" />\n    &lt;bpmn:userTask id=\"Activity_0yu8ycq\" storm:HTMLDescription=\"&amp;#60;p&amp;#62;Процесс с &amp;#38;nbsp;описанием&amp;#60;/p&amp;#62;\" storm:StormUrl=\"null\">\n      &lt;bpmn:incoming>SequenceFlow_1cqyhs3&lt;/bpmn:incoming>\n      &lt;bpmn:outgoing>Flow_01sknpp&lt;/bpmn:outgoing>\n    &lt;/bpmn:userTask>\n  &lt;/bpmn:process>\n  &lt;bpmndi:BPMNDiagram id=\"BPMNDiagram_1\">\n    &lt;bpmndi:BPMNPlane id=\"BPMNPlane_1\" bpmnElement=\"Process_1\">\n      &lt;bpmndi:BPMNEdge id=\"Flow_01sknpp_di\" bpmnElement=\"Flow_01sknpp\">\n        &lt;di:waypoint x=\"240\" y=\"410\" />\n        &lt;di:waypoint x=\"311\" y=\"410\" />\n        &lt;di:waypoint x=\"311\" y=\"179\" />\n        &lt;di:waypoint x=\"381\" y=\"179\" />\n      &lt;/bpmndi:BPMNEdge>\n      &lt;bpmndi:BPMNEdge id=\"SequenceFlow_1cqyhs3_di\" bpmnElement=\"SequenceFlow_1cqyhs3\">\n        &lt;di:waypoint x=\"-42\" y=\"179\" />\n        &lt;di:waypoint x=\"49\" y=\"179\" />\n        &lt;di:waypoint x=\"49\" y=\"410\" />\n        &lt;di:waypoint x=\"140\" y=\"410\" />\n      &lt;/bpmndi:BPMNEdge>\n      &lt;bpmndi:BPMNShape id=\"_BPMNShape_StartEvent_2\" bpmnElement=\"StartEvent_1\">\n        &lt;dc:Bounds x=\"-78\" y=\"161\" width=\"36\" height=\"36\" />\n      &lt;/bpmndi:BPMNShape>\n      &lt;bpmndi:BPMNShape id=\"EndEvent_0zk83sa_di\" bpmnElement=\"EndEvent_0zk83sa\">\n        &lt;dc:Bounds x=\"381\" y=\"161\" width=\"36\" height=\"36\" />\n      &lt;/bpmndi:BPMNShape>\n      &lt;bpmndi:BPMNShape id=\"Activity_13afhcv_di\" bpmnElement=\"Activity_0yu8ycq\">\n        &lt;dc:Bounds x=\"140\" y=\"370\" width=\"100\" height=\"80\" />\n      &lt;/bpmndi:BPMNShape>\n    &lt;/bpmndi:BPMNPlane>\n  &lt;/bpmndi:BPMNDiagram>\n&lt;/bpmn:definitions>\n"</span><span class="token punctuation">,</span>
        <span class="token string-property property">"name"</span><span class="token operator">:</span> <span class="token string">"Meetings"</span><span class="token punctuation">,</span> <span class="token comment">// имя процесса. По нему система определяет связь с процессом в системе.</span>
        <span class="token string-property property">"source"</span><span class="token operator">:</span> <span class="token string">"CamundaMeetingsBackend"</span> <span class="token comment">// источник. Используется для указания описания версии, чтобы было понятно откуда взялась эта версия.</span>
    <span class="token punctuation">}</span>
    <span class="token punctuation">]</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Тело ответа:</p>
<div class="language-javascript line-numbers-mode" data-ext="js" data-title="js"><pre v-pre class="language-javascript"><code><span class="token punctuation">{</span>
    <span class="token string-property property">"errors"</span><span class="token operator">:</span> <span class="token punctuation">{</span> <span class="token comment">//объект с ошибками </span>
        <span class="token string-property property">"emptyName"</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token comment">// массив внешних идентификаторов, у которых пустое имя.</span>
        <span class="token string-property property">"emptyDefinition"</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token comment">// массив внешних идентификаторов, у которых пустое тело.</span>
        <span class="token string-property property">"notXml"</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span> <span class="token comment">// массив внешних идентификаторов, у которых невалидный XML .</span>
    <span class="token punctuation">}</span><span class="token punctuation">,</span>
    <span class="token string-property property">"createdDiagrams"</span><span class="token operator">:</span> <span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">,</span> <span class="token comment">// массив созданных диаграмм, внутри такой же объект, как ниже.</span>
    <span class="token string-property property">"updatedDiagrams"</span><span class="token operator">:</span> <span class="token punctuation">[</span> <span class="token comment">// массив обновленных диаграмм.</span>
        <span class="token punctuation">{</span>
            <span class="token string-property property">"stormDiagramId"</span><span class="token operator">:</span> <span class="token string">"94d2e63f-f84a-40d4-b4a3-592b0cc7c7d9"</span><span class="token punctuation">,</span> <span class="token comment">//идентификактор в системе.</span>
            <span class="token string-property property">"sourceDiagramId"</span><span class="token operator">:</span> <span class="token string">"rhsrthsrth"</span> <span class="token comment">// внешний идентификатор</span>
        <span class="token punctuation">}</span>
    <span class="token punctuation">]</span>
<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ul>
<li>
<p>Максимум диаграмм в одном запросе - 20.</p>
</li>
<li>
<p>Диаграммы с одинаковым идентификатором обновляются в порядке запроса, поэтому вы можете загружать разные версии одной диаграммы для истории версий в одном запросе.</p>
</li>
<li>
<p>Поле <strong>Name</strong> очень важно для обновления диаграмм, никогда не меняйте его в Storm, если вы хотите обновлять диаграммы.</p>
</li>
</ul>
<div class="hint-container tip">
<p class="hint-container-title">Совет</p>
<p>Используйте этот shell-script, если используйте Camunda и хотите обновлять версии ваших диаграмм в Stormbpmn после успешного деплоя:</p>
<div class="language-text line-numbers-mode" data-ext="text" data-title="text"><pre v-pre class="language-text"><code>#!/bin/bash
# Going to build folder and reading all bpmn file
files=($(ls ./src/main/resources/bpmn/*.bpmn))
size=${#files[@]}
echo '[' > temp.json
counter=1
# Starting temp curl body file
echo Starting loop
# taking file by file
for file in ${files[*]}; do
  id="$(grep -Po '(?&lt;=&lt;bpmn:process\sid=")[^"]+' $file)"
  content="$(cat $file | sed 's/"/\\"/g;')"
  name="$(basename $file .bpmn)"
  echo '{"id":"'$id'","xml":"'$content'", "name": "'$name'", "source": "app"}' >> temp.json
  # Commas between objects shouldn't go at the end of the list
  if ((counter % 20)) &amp;&amp; ((size != counter)) ; then
    echo ',' >> temp.json
  fi
  # The limit of the API is 20 diagrams for request
  if ! ((counter % 20)); then
    echo ']' >> temp.json
    curl -X POST -H "X-Api-Key: API-KEY" -H "Content-Type: application/json" -d @temp.json stormbpmn.com/public-api/v1/upload-diagrams -i
    rm temp.json
    echo '[' > temp.json
  fi
  ((counter=counter+1))
  # Limitation of the API, no more then 5 request per minute
  if ((counter > 100)); then
    sleep 60
  fi
done
# Starting temp curl body file
# In cases when number of diagrams is not even to 20 we have to send the rest
echo ']' >> temp.json
curl -X POST -H "X-Api-Key: API_KEY" -H "Content-Type: application/json" -d @temp.json stormbpmn.com/public-api/v1/upload-diagrams -i
rm temp.json
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div></div>
<h3 id="загрузка-и-или-обновление-элементов-архитектуры" tabindex="-1"><a class="header-anchor" href="#загрузка-и-или-обновление-элементов-архитектуры"><span>Загрузка и\или обновление элементов архитектуры</span></a></h3>
<p>Для некоторых случаев использования (например, единый источник правды обо всех ваших элементах архитектуры в компании) вы можете легко загрузить их из вашего бэкенда в Stormbpmn.<br>
Путь: <strong>POST /public-api/v1/assets</strong><br>
Тело запроcа:</p>
<div class="language-javascript line-numbers-mode" data-ext="js" data-title="js"><pre v-pre class="language-javascript"><code><span class="token punctuation">[</span> 
  <span class="token punctuation">{</span>
    <span class="token string-property property">"id"</span><span class="token operator">:</span> <span class="token keyword">null</span><span class="token punctuation">,</span>  <span class="token comment">// ID элемента в системе. </span>
    <span class="token string-property property">"externalId"</span><span class="token operator">:</span> <span class="token keyword">null</span><span class="token punctuation">,</span>  <span class="token comment">//ID элемент во внешней системе.</span>
    <span class="token string-property property">"name"</span><span class="token operator">:</span> <span class="token string">"B2C USER"</span><span class="token punctuation">,</span> <span class="token comment">// Название.</span>
    <span class="token string-property property">"description"</span><span class="token operator">:</span> <span class="token string">""</span><span class="token punctuation">,</span> <span class="token comment">// Описание. Ожидается unescaped html, для отображения на UI.</span>
    <span class="token string-property property">"externalUrl"</span><span class="token operator">:</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token comment">// ссылка на внешнюю систему, можно прислать с плейсхолдером, например https://mywiki.corp.com/entity/${externalId}</span>
    <span class="token string-property property">"type"</span><span class="token operator">:</span> <span class="token string">"CLIENT"</span> <span class="token comment">// тип элемент архитектуры. Возможные значения UNSPECIFIED, DOCUMENT, SYSTEM, COMMUNCATION, CLIENT, ENTITY, ACTION, OTHER</span>
    <span class="token string-property property">"status"</span><span class="token operator">:</span> <span class="token string">"NEW"</span> <span class="token comment">// статус элемента архитектуры. Возможные значения NEW, TRIAL, PRODUCTION, DECOMMISSIONING, ARCHIVE </span>
  <span class="token punctuation">}</span>
<span class="token punctuation">]</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Тело ответа:</p>
<div class="language-javascript line-numbers-mode" data-ext="js" data-title="js"><pre v-pre class="language-javascript"><code><span class="token punctuation">[</span> 
  <span class="token punctuation">{</span>
    <span class="token string-property property">"id"</span><span class="token operator">:</span> <span class="token number">234234</span><span class="token punctuation">,</span>  <span class="token comment">// ID элемента в системе. </span>
    <span class="token string-property property">"externalId"</span><span class="token operator">:</span> <span class="token keyword">null</span><span class="token punctuation">,</span>  <span class="token comment">//ID элемент во внешней системе.</span>
    <span class="token string-property property">"name"</span><span class="token operator">:</span> <span class="token string">"B2C USER"</span><span class="token punctuation">,</span> <span class="token comment">// Название.</span>
    <span class="token string-property property">"description"</span><span class="token operator">:</span> <span class="token string">""</span><span class="token punctuation">,</span> <span class="token comment">// Описание. Ожидается unescaped html, для отображения на UI.</span>
    <span class="token string-property property">"externalUrl"</span><span class="token operator">:</span> <span class="token keyword">null</span><span class="token punctuation">,</span> <span class="token comment">// ссылка на внешнюю систему, можно прислать с плейсхолдером, например https://mywiki.corp.com/entity/${externalId}</span>
    <span class="token string-property property">"type"</span><span class="token operator">:</span> <span class="token string">"CLIENT"</span><span class="token punctuation">,</span> <span class="token comment">// тип элемент архитектуры. Возможные значения UNSPECIFIED, DOCUMENT, SYSTEM, COMMUNCATION, CLIENT, ENTITY, ACTION, OTHER.</span>
    <span class="token string-property property">"status"</span><span class="token operator">:</span> <span class="token string">"NEW"</span><span class="token punctuation">,</span> <span class="token comment">// статус элемента архитектуры. Возможные значения NEW, TRIAL, PRODUCTION, DECOMMISSIONING, ARCHIVE.</span>
    <span class="token string-property property">"createdOn"</span><span class="token operator">:</span> <span class="token string">"2024-05-02T17:19:41.459888"</span><span class="token punctuation">,</span> <span class="token comment">// Дата создания.</span>
    <span class="token string-property property">"updatedOn "</span><span class="token operator">:</span> <span class="token string">"2024-05-02T17:19:41.459888"</span> <span class="token comment">// Дата обновления.</span>
    <span class="token string-property property">"updatedBy  "</span><span class="token operator">:</span> <span class="token string">"kotov@bpmn2.ru"</span> <span class="token comment">// Дата обновления.</span>
  <span class="token punctuation">}</span>
<span class="token punctuation">]</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><ul>
<li>Если <strong>id</strong> или <strong>externalId</strong> не указаны, будет создан новый ЭА. Если вы укажете <strong>externalId</strong>, Storm обновит этот актив. Если вы укажете <strong>id</strong>, Storm обновит этот актив. Если вы укажете <strong>externalId</strong> и <strong>id</strong>, будет обновлен актив с <strong>id</strong>. Тип по умолчанию - UNSPECIFIED.</li>
<li>Максимум элементов архитектуры в одном запросе - 20.</li>
</ul>
<h3 id="получение-списка-диаграмм-команды" tabindex="-1"><a class="header-anchor" href="#получение-списка-диаграмм-команды"><span>Получение списка диаграмм команды</span></a></h3>
<p>Полученный список диаграмм будет зависить от прав на диаграммы у администратора команды.</p>
<p>Путь: <strong>GET /public-api/v1/get-diagram-list</strong><br>
Query-параметры: <strong>page</strong> - указание на текущую страницу, отсчет с 0. Обязателен.</p>
