<p>Получение диаграммы будет зависить от прав администатора команды на диаграмму.</p>
<p>Путь: <strong>POST /public-api/v1/element-description/{diagramId}/{elementId}</strong><br>
Переменные пути:</p>
<ul>
<li>{diagramId} - UUID диаграммы на сервере storm. Обязателен.</li>
<li>{elementId} - идентификатор элемента на диаграмме. Обязателен.
Тело запроcа:</li>
</ul>
<div class="language-javascript line-numbers-mode" data-ext="js" data-title="js"><pre v-pre class="language-javascript"><code><span class="token punctuation">{</span>
