    <span class="token string-property property">"externalLink"</span><span class="token operator">:</span> <span class="token string">"https://bash.im"</span> <span class="token comment">// внешняя ссылка</span>

<span class="token punctuation">}</span>
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Тело ответа:</p>
